import {BrowserRouter, Route, Routes} from 'react-router-dom';
import './App.css';
import {Header} from "./Header";
import {Card} from "./Card";
import {List} from "./List";
import {Select} from "./Select";

const managerList = [
    {
        firstName: 'Дмитрий',
        lastName: 'Рогозин'
    },
    {
        firstName: 'Алексей',
        lastName: 'Рогозин'
    },
    {
        firstName: 'Анатолий',
        lastName: 'Рогозин'
    }
];

const options =  [
    'Антон',
    'Антонвыа',
    'Антоныва',
    'Антоныва',
];


function App() {
    return (
        <div className="App">
            <Select options={options} placeholder="Выберите"/>
            <BrowserRouter>
                <Header>Личный кабинет руководителя банковского отдела</Header>
                <div className="Content">
                    <Routes>
                        <Route path="/" element={
                            <>
                                <Card title="Список менеджеров">
                                    <List
                                        arrayList={managerList}
                                        pathToAdd={"/add/manager"}
                                    />
                                </Card>
                                <Card title="Список клиентов">
                                    <List
                                        arrayList={managerList}
                                        pathToAdd={"/add/client"}
                                    />
                                </Card>
                            </>
                        }/>
                        <Route path="/add/manager" element={
                            <Card title="Добавление менеджера">
                                <List
                                    arrayList={managerList}
                                    pathToAdd={"/"}
                                />
                            </Card>
                        }/>
                        <Route path="/add/client" element={
                            <Card title="Добавление клиента">
                                <List
                                    arrayList={managerList}
                                    pathToAdd={"/"}
                                />
                            </Card>
                        }/>
                    </Routes>
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
